/* global console */

(function ($, Spire, undefined) {

    Spire.satalliteSlider_init = function (){

        // Satal
        var canvas = $('#satellite-orbit');
        var slider = $('.calculator-slider');

        if(canvas != undefined && slider != undefined) {
            var WIDTH = $(canvas).parent().outerWidth();
            var HEIGHT = $(canvas).parent().outerHeight() + $(canvas).parent().outerHeight() * 0.3;
            var RATIO = 5.55;
            $(canvas).width(WIDTH * window.devicePixelRatio);
            $(canvas).height(HEIGHT * window.devicePixelRatio);
            canvas[0].width = $(canvas).width();
            canvas[0].height = $(canvas).height();

            var ctx = $(canvas)[0].getContext('2d');

            var radius = $(canvas).parent().outerHeight() - $(canvas).parent().outerHeight() / RATIO;
            var centerX = $(canvas).width() / window.devicePixelRatio / 2;
            var centerY = $(canvas).height() / window.devicePixelRatio - $(canvas).parent().outerHeight() / RATIO;
            var sX = 0;
            var sY = 0;
            var sW = 72;
            var sH = 72;
            var gW = 507;
            var gH = 507;
            var i = 0;

            var satellites = [
                //        {startAngle: -510, endAngle: 85 * 8},     // 1
                //        {startAngle: -380, endAngle: 91 * 8},     // 2
                //        {startAngle: -230, endAngle: 100.5 * 6},  // 3
                //        {startAngle: 155, endAngle: 69.5 * 8},    // 4
                //        {startAngle: 480, endAngle: 82 * 8},      // 5
                //        {startAngle: 550, endAngle: 88 * 8},      // 6
                //        {startAngle: 10, endAngle: 72.5 * 8},     // 7
                //        {startAngle: 580, endAngle: 82.5 * 12},   // 8
                //        {startAngle: -420, endAngle: 66.5 * 8}    // 9

                {startAngle: -510, endAngle: 85 * 8},   // 1
                {startAngle: 90, endAngle: 91 * 8},     // 2
                {startAngle: -310, endAngle: 61 * 4},   // 3
                {startAngle: -5, endAngle: 69.5 * 8},   // 4
                {startAngle: 420, endAngle: 82 * 8},    // 5
                {startAngle: 320, endAngle: 88 * 8},    // 6
                {startAngle: 280, endAngle: 72.5 * 8},  // 7
                {startAngle: 580, endAngle: 82.5 * 12}, // 8
                {startAngle: -40, endAngle: 66.5 * 8}   // 9
            ];
            var curValue = 0;
            var numSats = 2;
            var maxSats = satellites.length;

            function deg2rad(deg) {
                return deg * Math.PI / 180;
            }

            function lerp(v0, v1, t) {
                return (1 - t) * v0 + t * v1;
            }

            function drawGuide() {
                ctx.beginPath();
                ctx.arc(centerX, centerY, radius, 0, 2 * Math.PI, false);
                ctx.lineWidth = 2;
                ctx.strokeStyle = 'rgba(215, 215, 215, 0.25)';
                ctx.stroke();
            }

            var sat = new Image();

            sat.src = 'data:image/png;base64,';

            var globe = new Image();
            globe.src = 'data:image/png;base64,';
            globe.onload = function () {
                //$(document).trigger({type: 'sliderUpdate', value: $(slider).data('value')});
                $(window).trigger('resize');
            };

            $(document).on('sliderUpdate', function (sliderEvent) {

                curValue = sliderEvent.value;
                numSats = Math.ceil(curValue * 10);

                if (numSats === 0) {
                    numSats = 1;
                } else if (numSats > maxSats) {
                    numSats = maxSats;
                }

                ctx.clearRect(0, 0, $(canvas).width(), $(canvas).height());

                if (WIDTH <= 640) {
                    sW = 64;
                    sH = 64;
                    gW = 320;
                    gH = 320;
                } else {
                    sW = 72;
                    sH = 72;
                    gW = 507;
                    gH = 507;
                }

                drawGuide(centerX, centerY);

                ctx.save();
                ctx.translate(centerX, centerY);
                ctx.rotate(deg2rad(lerp(0, 20, curValue)));
                ctx.translate(-centerX, -centerY);
                ctx.drawImage(globe, centerX - gW / 2, centerY - gH / 2, gW, gH);
                ctx.restore();

                for (i; i < numSats; i++) {
                    var s = satellites[i];
                    var angle = deg2rad(lerp(s.startAngle, s.endAngle, curValue));
                    sX = centerX + radius * Math.cos(angle);
                    sY = centerY + radius * Math.sin(angle);

                    ctx.save();
                    ctx.translate(sX, sY);
                    ctx.rotate(deg2rad(lerp(s.startAngle, s.endAngle, curValue) + 90));
                    ctx.translate(-sX, -sY);
                    ctx.drawImage(sat, sX - sW / 2, sY - sH / 1.5, sW, sH);
                    //ctx.fillText(i+1,sX,sY);
                    ctx.restore();
                }

                i = 0;
            });

            $(window).resize(function () {
                WIDTH = $(canvas).parent().outerWidth();
                HEIGHT = $(canvas).parent().outerHeight() + $(canvas).parent().outerHeight() * 0.3;
                $(canvas).width(WIDTH * window.devicePixelRatio);
                $(canvas).height(HEIGHT * window.devicePixelRatio);
                canvas[0].width = $(canvas).width();
                canvas[0].height = $(canvas).height();

                if (window.devicePixelRatio > 1) {
                    canvas[0].style.width = $(canvas).width() / window.devicePixelRatio + 'px';
                    canvas[0].style.height = $(canvas).height() / window.devicePixelRatio + 'px';
                }

                radius = $(canvas).parent().outerHeight() - $(canvas).parent().outerHeight() / RATIO;
                centerX = $(canvas).width() / 2;
                centerY = $(canvas).height() - $(canvas).parent().outerHeight() / RATIO;

                ctx.scale(window.devicePixelRatio, window.devicePixelRatio);

                $(document).trigger({type: 'sliderUpdate', value: $(slider).data('value')});
            });

            $('.globe-wrapper img').on('load', function () {
                $(window).trigger('resize');
            });
        }


        // Slider
        var factor = 382.865361321923;
        var exponent = -1.05130229144626;

        var CalculatorSlider = function (slider) {
            var debug = false;
            var sliderElement = $(slider);
            var sliderHandle = $(sliderElement.find('.calculator-slider-handle'));
            var sliderProgress = $(sliderElement.find('.calculator-slider-progress'));
            var sliderOffset = null;
            var sliderPage = $('body');
            var sliderWindow = $(window);
            var currentValue = 0;
            var valueSatellites = $('#calculator-value-satellites');
            var valueMinutes = $('#calculator-value-time');
            var valueGpsProfiles = $('#calculator-value-gps');
            var valueImprovement = $('#calculator-value-improvement');
            var valueSatellitesSense = $('#calculator-value-satellites-sense');
            var valueImprovementSense = $('#calculator-value-improvement-sense');
            var valueMinutesSense = $('#calculator-value-time-sense');

            var init = function () {
                sliderElement.on('mousedown touchstart', mouseDown);
                _updateHandlePosition(parseFloat(sliderHandle.css('left')));

                if (debug === true) {
                    console.log(sliderElement);
                }
            };

            var mouseDown = function (e) {
                _disableEvents(e);

                sliderPage.css('cursor', 'grabbing');
                sliderHandle.css('cursor', 'grabbing');
                sliderOffset = _eventClientX(e) - sliderHandle.offset().left;
                sliderWindow.on('mouseup touchend', mouseUp);
                sliderWindow.on('mousemove touchmove', mouseMove);
            };

            var mouseMove = function (e) {
                var sliderPosition = _eventClientX(e) - sliderElement.offset().left - sliderOffset;
                _updateHandlePosition(sliderPosition);
            };

            var mouseUp = function () {
                sliderWindow.off('mousemove');
                sliderWindow.off('mouseup');
                sliderOffset = null;
                sliderHandle.css('cursor', 'grab');
                sliderPage.css('cursor', 'auto');

                _enableEvents();
            };

            var _eventClientX = function (e) {
                return e.clientX || e.originalEvent.touches[0].clientX;
            };

            var _disableEvents = function (e) {
                e.stopPropagation();
                e.preventDefault();
                e.stopImmediatePropagation();
            };

            var _enableEvents = function () {
                //sliderWindow.unbind();
                sliderWindow.off('mouseup touchend');
                sliderWindow.off('mousemove touchmove');
            };

            var _updateHandlePosition = function (sliderPosition) {
                sliderPosition = Math.max(-(sliderHandle.width() / 2), sliderPosition);
                sliderPosition = Math.min(sliderElement.width() - (sliderHandle.width() / 2), sliderPosition);

                sliderHandle.css('left', sliderPosition / sliderElement.width() * 100 + '%');
                sliderProgress.css('width', sliderPosition / sliderElement.width() * 100 + '%');
                currentValue = (sliderPosition + (sliderHandle.width() / 2)) / sliderElement.width();

                $.event.trigger({
                    type: 'sliderUpdate',
                    value: currentValue
                });

                $(slider).data('value', currentValue);

                _updateCalculator(currentValue);
            };

            var _updateCalculator = function (sliderValue) {
                var satelliteNumber = Math.max(2, Math.ceil(sliderValue * 100));
                //var revisitTime = lnIncrease * Math.log(satelliteNumber) + lnInitial;
                var revisitTime = Math.pow(satelliteNumber, exponent) * factor;
                var gpsProfile =  (Math.round((1000 * satelliteNumber * 365) / 10000) / 100);
                var improvementFactor = Math.round((1000 * satelliteNumber) / 2000);
                var satelliteNumberSense = Math.max(6, Math.ceil(sliderValue * 100));
                var revisitTimeSense = Math.pow(satelliteNumberSense, exponent) * factor;
                var improvementFactorSense = Math.round(60 / revisitTimeSense);


                valueSatellites.text(satelliteNumber);
                valueMinutes.text(revisitTime.toFixed(1));
                valueImprovement.text(improvementFactor);
                valueGpsProfiles.text(gpsProfile);
                valueSatellitesSense.text(satelliteNumberSense);
                valueImprovementSense.text(improvementFactorSense);
                valueMinutesSense.text(revisitTimeSense.toFixed(1));
            };

            init();
        };

        $('.calculator-slider').each(function () {
            return new CalculatorSlider(this);
        });

    };

}(jQuery, window.Spire = window.Spire || {}));
